const Gallery = () => {
  return (
    <>
      <img src="/matty4.jpeg" width="400" height="560" />
      <img id="image2" src="matty2.jpg" width="250" height="355" />
      <img id="image3" src="mattyperform.jpg" width="540" height="350" />
      <img id="image4" src="matty3.jpg" width="800" height="520" />
    </>
  );
};

export default Gallery;
